import React from 'react';

const allArticles = () => {
  listArticles.map(item => {
    <List key={item.id} itemArticle={item} />
  })
}

const List = ({itemArticle}) => {
  return (
    <ul>
      <li key={item.id}>
        <h2>itemArticle</h2>
      </li>
    </ul>
  );
};

export default List;
